import { CREATE_ACCOUNT, LOG_IN } from '../actions/types';

const initialState = {
    user : []
}

export default function(state = initialState, action) {
    switch (action.type) {
        case CREATE_ACCOUNT:
            console.log('reducer')
            return {
                ...state
            };
        // case LOG_IN: 
        //     return {
        //         ...state,
        //         user: action.payload
        //     }
        default:
            return state;
    }
}
